import logo from './logo.svg';
import './App.css';

let name="Mohammad Afzal"
function App() {
  return (
    <>
    <h1 className="heading" > Welcome to my {name} First App</h1>
    <ul>
      <li>Home</li>
      <li>About Us</li>
      <li> Contact</li>
    </ul>
   </>
  );
}

export default App;
